import { StatusBar } from 'expo-status-bar';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import LoginScreen from './src/screens/LoginScreen';
import DashboardScreen from './src/screens/DashboardScreen';
import ElectricityScreen from './src/screens/ElectricityScreen';
import WaterScreen from './src/screens/WaterScreen';
import GasScreen from './src/screens/GasScreen';
import PropertyScreen from './src/screens/PropertyScreen';
import UtilityServicesScreen from './src/screens/UtilityServicesScreen';
import CompanyFormationScreen from './src/screens/CompanyFormationScreen';
import GovernmentGrantsScreen from './src/screens/GovernmentGrantsScreen';
import ApplicationFormScreen from './src/screens/ApplicationFormScreen';
import DocumentLibraryScreen from './src/screens/DocumentLibraryScreen';

const Stack = createStackNavigator();

export default function App() {
    return (
        <NavigationContainer>
            <Stack.Navigator initialRouteName="Login">
                <Stack.Screen
                    name="Login"
                    component={LoginScreen}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="Dashboard"
                    component={DashboardScreen}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="UtilityServices"
                    component={UtilityServicesScreen}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="Electricity"
                    component={ElectricityScreen}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="Water"
                    component={WaterScreen}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="Gas"
                    component={GasScreen}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="Property"
                    component={PropertyScreen}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="CompanyFormation"
                    component={CompanyFormationScreen}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="GovernmentGrants"
                    component={GovernmentGrantsScreen}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="ApplicationForm"
                    component={ApplicationFormScreen}
                    options={{ headerShown: false }}
                />
                <Stack.Screen
                    name="DocumentLibrary"
                    component={DocumentLibraryScreen}
                    options={{ headerShown: false }}
                />
            </Stack.Navigator>
            <StatusBar style="auto" />
        </NavigationContainer>
    );
}
